import React from 'react'
import {Form, Link} from 'react-bootstrap'

function Home() {
  return (
    <Form>
    <div><h1>Home</h1></div>
    <Form.Group>
    <Link to='/login'>Create an account</Link>
    </Form.Group>

    </Form>

  )
}

export default Home
